V8:
- Yasamal rayonu, Moskva pr. ünvanında “Main MTK” Elit yaşayış Kompleksində 5 otaqlı, 176 m² lüks yeni təmirli mənzili satışa təqdim edirik!

Mənzilin xüsusiyyətləri:
- 176 m², 4 otaqdan 5 otağa düzəlmə , 2 s/q;
- Geniş və işıqlı, gün görən otağlar;
- Yarım yelçəkən;
- Xüsusi zövqlə dizayn edilib
- Möhtəşəm yeni bahalı + keyfiyyətli təmir
- Döşəmə keyfiyyətli bred laminat + qranit mərmər
- Zambaiti divar kağızları
- İsti döşəmə və Kombi sistemi;
- Yeni mətbəx mebeli.

Binanın xüsusiyyətləri:
- 20 mərtəbəli binanın 9cu mərtəbəsi;
- Daimi qaz, su və işıq təchizatı;
- Avtomobillər üçün 2 yeraltı qaraj;
- Binada 3 lift mövcuddur;
- 24 saat təhlükəsizlik kamera və mühafizə xidməti;

Ətraflı məlumat üçün qeyd olunan nömrə ilə əlaqə saxlaya bilərsiniz.

Xidmət haqqi 1 % təşkil edir.

Olimpus Nəsimi 19 mərtəbəli yenitikili binanın 16-cı mərtəbəsində 190.7 kvm, 4 otaqlı, şəhər və dəniz panoramalı, təmirsiz mənzil satılır.
Bina yüksək infrastruktura malikdir, yaxınlıqda universitetlər, məktəb və baxçalar, parklar, böyük marketlər var.
Ofisin xidmət haqqı 1%

Kompleks haqqında:

geniş qapalı həyət;
üçmərtəbəli ticarət mərkəzi - Nəsimi Moll;
iki mərtəbəli yeraltı parkinq;
müvvəqəti avtomobil dayanacaqları üçün parkovka yeriləri;
çardaqlı və açıq oturacaq yerləri olan istirahət zonası;
həyətin mərkəzində yerləşən, slaydlar və yelləncəkləri olan uşaq meydançası.
video nəzarət kameraları;
mühafizə xidməti;
birinci mərtəbələrdə qəbul-yerləşdirmə xidməti.
